import React from "react";
import PartnerForm from "../components/PartnerForm";

export default function BecomePartner() {
  return (
    <div style={{ padding: "40px" }}>
      <h1 style={{ textAlign: "center", marginBottom: "30px" }}>
        Become a Partner
      </h1>
      <PartnerForm />
    </div>
  );
}
